  const contacts = [
    {
      id : "1",
      name : "Sreeni",
      email : "sreeni@gmail.com"
    }
  ];
  return(
    <div className="ui container App">
      <Header />
      <AddContact />
      <ContactList />
    </div>
)
}
export default App;
